snippet.description:
Play in browser here:  https://jaideng123.itch.io/rebound 

Rebound is a game about about relaxing and cleaning books.

Carefully crafted over 2 weeks for the 2021 Seattle Indies Slow Jam

Team

@ZRubyWorks - 3D Artist
@lzklein - Sound Designer, Composer
@JaidenG123 - Engineer
@bordenary - 3D Artist
@BrandnGarcia - Producer, VFX

Check out the OST here: https://songwhip.com/louisklein/lofi-beats-to-bind-books-to

